```java
ModelMapper modelMapper = new ModelMapper();

User user = new User();
user.setName("John Doe");
user.setAge(30);

UserDTO userDTO = modelMapper.map(user, UserDTO.class);
```

In this example, ModelMapper automatically maps the properties from `User` to `UserDTO`. You can customize the mapping if needed.

